import React, {FC} from 'react';
import {ITrip} from "../../../types/types";
import Card from "../../common/Card/Card";

interface IPropTypes {
    trips: ITrip[]
}

const TripPage:FC<IPropTypes> = ({trips}) => {
    return (
        <div>
            {trips?.map(trip => <Card trip={trip} />)}
        </div>
    );
};

export default TripPage;
